import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import FaceDetectionTest from './FaceDetectionTest';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

const NavWrapper = () => {
  return (
    <BrowserRouter>
      <div style={{ padding: '10px' }}>
        <nav style={{ marginBottom: '20px', display: 'flex', gap: '15px' }}>
          <Link to="/" style={{ padding: '8px 16px', backgroundColor: '#2196F3', color: 'white', textDecoration: 'none', borderRadius: '4px' }}>
            Main App
          </Link>
          <Link to="/face-test" style={{ padding: '8px 16px', backgroundColor: '#2196F3', color: 'white', textDecoration: 'none', borderRadius: '4px' }}>
            Face Detection Test
          </Link>
        </nav>
        
        <Routes>
          <Route path="/" element={<App />} />
          <Route path="/face-test" element={<FaceDetectionTest />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <NavWrapper />
  </React.StrictMode>
);
